    function getDepartmentDetails(id) {
        $.ajax({
            url: '/Admin/GetDepartmentDetails/' + id,
            type: 'GET',
            success: function (data) {
                $('#Dept_Name').val(data.name);
                $('#Dept_Code').val(data.code);
                $('#Dept_Id').val(data.id);
            },
            error: function () {
                alert('Failed to fetch department details.');
            }
        });
    }
